import './NavBar.css';
import NavItem from '../navitem/NavItem';
const NavBar = () => {

    const myNavItem = [
        "Home",
        "Club",
        "Booking",
        "Competition"
    ];
    return (
        <div className="NavBar">
            <ul className="NavBar-ul">
                <NavItem/>
            </ul>
        </div>
    );
};

export default NavBar;
